import React, { Component } from 'react'
import './Head.css'
class Head extends Component {
  render() {
    return (
      <div class="search-box">
        <input
          type="text"
          class="search-txt"
          name=""
          placeholder="Type to search"
        />
        <a class="search-btn" href="#">
          <i class="fas fa-search"></i>
        </a>
      </div>
    )
  }
}

export default Head
